const Wrapper = styled.div`
    padding: 20px;
`;

const Title = styled.div`
    font-weight: bold;
    letter-spacing: 3px;
    font-family: Poppins;
    text-align: center;
`;

const Top = styled.div``;

const Bottom = styled.div``;

const Cart = () => {
  return (
    <Container>
        <Navbar />
        <Announcement />
        <Wrapper>
            <Title>YOUR BAG</Title>
            <Top></Top>
            <Bottom></Bottom>
        </Wrapper>
        <Footer />

    </Container>
  )
}

export default Cart
